def allCharsDifferent(chars):
    for i in range(0, len(chars)):
        for j in range(i + 1,len(chars)):
            if chars[i] == chars[j]:
                return False
    return True


signal = ""
count = 4
chars14 = []
for i in range(0, 14):
    chars14.append(signal[i])

while True:
    if allCharsDifferent(chars14):
        print(count)
        break
    chars14.pop(0)
    chars14.append(signal[count])
    count += 1
